DROP TABLE IF EXISTS `ynf_nanny`;
CREATE TABLE `ynf_nanny` (
  `nanny_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '保姆',
  `comp_id` int(11) DEFAULT NULL COMMENT '公司ID',
  `number` varchar(20) DEFAULT NULL COMMENT '编号',
  `name` varchar(20) DEFAULT NULL COMMENT '姓名',
  `head_img` varchar(255) DEFAULT NULL COMMENT '头像',
  `id_card` varchar(18) DEFAULT NULL COMMENT '身份证号码',
  `phone` varchar(15) DEFAULT NULL COMMENT '手机号',
  `type` varchar(255) DEFAULT NULL COMMENT '类型 0住家保姆 1非住家保姆 2月嫂 3护工 4育儿嫂',
  `native_place` varchar(30) DEFAULT NULL COMMENT '籍贯',
  `nation` varchar(50) DEFAULT NULL COMMENT '名字',
  `marriage` tinyint(1) DEFAULT '1' COMMENT '0未婚 1已婚',
  `age` int(3) DEFAULT NULL COMMENT '年龄',
  `city` varchar(255) DEFAULT NULL COMMENT '当前所在城市',
  `education` varchar(255) DEFAULT NULL COMMENT '学历',
  `experience` int(11) DEFAULT NULL COMMENT '经验 单位：月',
  `state` int(1) DEFAULT NULL COMMENT '0待岗 1在岗 2不在岗',
  `salary` double DEFAULT NULL COMMENT '月薪 单位：元',
  `company` varchar(255) DEFAULT NULL COMMENT '所属家政服务',
  `power` int(11) DEFAULT NULL COMMENT '能力 数字越大能力越强',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `data_flag` tinyint(1) DEFAULT '1' COMMENT '0无效 1有效',
  PRIMARY KEY (`nanny_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

