-- ----------------------------
-- Table structure for ynf_order
-- ----------------------------
DROP TABLE IF EXISTS `ynf_order`;
CREATE TABLE `ynf_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '家政订单',
  `order_num` varchar(32) DEFAULT NULL COMMENT '订单号',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `goods_id` int(11) DEFAULT NULL COMMENT '服务商品id',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名称(服务项目)',
  `pay_money` float(8,2) DEFAULT NULL COMMENT '支付金额',
  `pay_status` tinyint(4) DEFAULT NULL COMMENT '支付状态 0未支付  1支付成功',
  `order_status` tinyint(4) DEFAULT NULL COMMENT '订单状态(0关闭 1待支付 2进行中 3已完成 4取消)',
  `attemper_status` tinyint(4) DEFAULT NULL COMMENT '调度状态 0下单成功  1调度成功(已接单)  2上门服务  3完成  4（用户已取消）',
  `aunt_id` int(11) DEFAULT NULL COMMENT '服务阿姨id',
  `pay_way` tinyint(4) DEFAULT '0' COMMENT '支付方式  0线上支付  1货到付款',
  `pay_type` tinyint(4) DEFAULT NULL COMMENT '第三方交易类型  2支付宝  1微信',
  `pay_num` varchar(100) DEFAULT NULL COMMENT '第三方交易号',
  `total_money` float(8,2) DEFAULT NULL COMMENT '订单总额',
  `discounts` float(8,2) DEFAULT NULL COMMENT '优惠金额',
  `customer` varchar(20) DEFAULT NULL COMMENT '客户',
  `phone` varchar(20) DEFAULT NULL COMMENT '客户电话',
  `region` varchar(50) DEFAULT NULL COMMENT '客户所在省市区格式 (省-市-区)',
  `address` varchar(255) DEFAULT NULL COMMENT '客户详细地址',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  `cancel_cause` varchar(100) DEFAULT NULL COMMENT '取消服务原因',
  `origin` tinyint(4) DEFAULT NULL COMMENT '订单来源 1颐纳福APP  2微信客户端  3浏览器',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `service_time` varchar(50) DEFAULT NULL COMMENT '预约服务时间',
  `begin_time` datetime DEFAULT NULL COMMENT '服务开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '服务结束时间',
  `clean_result` varchar(300) DEFAULT NULL COMMENT '清理結果',
  `clean_image` varchar(255) DEFAULT NULL COMMENT '清理结果相关图片',
  `complete_time` datetime DEFAULT NULL COMMENT '完成时间 ',
  `evaluate_time` datetime DEFAULT NULL COMMENT '评价时间',
  `create_time` datetime DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `data_flag` tinyint(4) DEFAULT '1' COMMENT '数据是否有效 0无效 1有效',
  `coupon_id` int(11) DEFAULT NULL COMMENT '优惠券id',
  `order_type` int(1) DEFAULT NULL COMMENT '类型 0单次收费 1定金商品 2抢单',
  `nanny_id` int(11) DEFAULT NULL COMMENT '保姆id',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=355 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of ynf_order
-- ----------------------------

