DROP TABLE IF EXISTS `ynf_service_goods`;
CREATE TABLE `ynf_service_goods` (
  `goods_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品服务',
  `cate_id` int(11) DEFAULT NULL COMMENT '分类id',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '服务商品名称',
  `goods_pic` text COMMENT '商品图片(多张用逗号分隔)',
  `short_introduce` varchar(200) DEFAULT NULL COMMENT '短介绍',
  `original_price` float(8,2) DEFAULT NULL COMMENT '原价',
  `current_price` float(8,2) DEFAULT NULL COMMENT '现价',
  `goods_intro` text COMMENT '服务介绍(弃用)',
  `goods_scope` text COMMENT '服务范围(弃用)',
  `goods_process` text COMMENT '服务流程(弃用)',
  `goods_sales` int(10) DEFAULT NULL COMMENT '销售数量',
  `goods_type` int(1) DEFAULT NULL COMMENT '商品类型(0单次收费 1定金商品 2抢单)',
  `index_type` tinyint(4) DEFAULT NULL COMMENT '1首页热门推荐 2精选套餐 (弃用)',
  `is_type` tinyint(4) DEFAULT '0' COMMENT '是否服务时长类型(弃用)',
  `create_time` datetime DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `data_flag` tinyint(2) DEFAULT '1' COMMENT '数据是否有效 0无效  1有效',
  `goods_details` text COMMENT '商品详情(图片)',
  `goods_state` tinyint(4) DEFAULT '1' COMMENT '商品状态(0下架 1上架)',
  `is_hot` tinyint(4) DEFAULT '0' COMMENT '是否热销(0不是 1是)',
  `is_cxiao` tinyint(4) DEFAULT '0' COMMENT '是否畅销(0不是 1是)',
  `comp_id` int(11) DEFAULT NULL COMMENT '公司ID',
  PRIMARY KEY (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

